export const traderProfiles = {
  dayTrader: {
    // ResponsiveReactGridLayout expects layouts object with breakpoint keys
    layout: {
      lg: [
        { 
          i: 'chart', 
          x: 0, 
          y: 0, 
          w: 8,           // Width: 8 columns
          h: 8,           // Height: 8 rows
          minW: 4,        // MUST be ≤ w (8)
          maxW: 12,       // MUST be ≥ w (8)
          minH: 4,        // MUST be ≤ h (8)
          maxH: 12        // MUST be ≥ h (8)
        },
        { 
          i: 'orderbook', 
          x: 8, 
          y: 0, 
          w: 4,           // Width: 4 columns
          h: 8,           // Height: 8 rows
          minW: 3,        // MUST be ≤ w (4)
          maxW: 6,        // MUST be ≥ w (4)
          minH: 4,        // MUST be ≤ h (8)
          maxH: 12        // MUST be ≥ h (8)
        }
      ],
      md: [
        { i: 'chart', x: 0, y: 0, w: 6, h: 6, minW: 4, maxW: 10 },
        { i: 'orderbook', x: 6, y: 0, w: 4, h: 6, minW: 3, maxW: 6 }
      ],
      sm: [
        { i: 'chart', x: 0, y: 0, w: 6, h: 6, minW: 4, maxW: 6 },
        { i: 'orderbook', x: 0, y: 6, w: 6, h: 4, minW: 4, maxW: 6 }
      ]
    },
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'orderbook', type: 'orderbook' }
    ]
  },
  investor: {
    layout: {
      lg: [
        { i: 'chart', x: 0, y: 0, w: 8, h: 6, minW: 4, maxW: 12, minH: 4, maxH: 10 },
        { i: 'fundamentals', x: 8, y: 0, w: 4, h: 6, minW: 3, maxW: 6, minH: 4, maxH: 8 }
      ],
      md: [
        { i: 'chart', x: 0, y: 0, w: 6, h: 6, minW: 4, maxW: 10 },
        { i: 'fundamentals', x: 6, y: 0, w: 4, h: 6, minW: 3, maxW: 6 }
      ],
      sm: [
        { i: 'chart', x: 0, y: 0, w: 6, h: 6, minW: 4, maxW: 6 },
        { i: 'fundamentals', x: 0, y: 6, w: 6, h: 4, minW: 4, maxW: 6 }
      ]
    },
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'fundamentals', type: 'fundamentals' }
    ]
  }
};
